import React, { useState, useEffect } from 'react';
import { Typography, Box, Card, CardContent, Grid, Button, LinearProgress, Chip } from '@mui/material';
import { motion } from 'framer-motion';
import axios from 'axios';
import { useAuth } from '../context/AuthContext';

const Dashboard = () => {
  const { auth } = useAuth();
  const [courses, setCourses] = useState([]);
  const xpToNext = (auth.user?.level || 1) * 100;
  const progress = (auth.user?.xp || 0) / xpToNext * 100;

  useEffect(() => {
    axios.get('http://localhost:5000/api/courses')
      .then(res => setCourses(res.data))
      .catch(err => console.error(err));
  }, []);

  return (
    <Box mt={5}>
      <motion.div initial={{ opacity: 0, y: 20 }} animate={{ opacity: 1, y: 0 }} transition={{ duration: 0.5 }}>
        <Typography variant="h2" gutterBottom sx={{ color: '#3f51b5', fontWeight: 'bold' }}>
          üåü Welcome, {auth.user?.username}!
        </Typography>
        <Grid container spacing={3}>
          <Grid item xs={12} md={4}>
            <motion.div whileHover={{ scale: 1.05 }}>
              <Card sx={{ bgcolor: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)', color: 'white' }}>
                <CardContent>
                  <Typography variant="h4">üèÜ Level {auth.user?.level}</Typography>
                  <LinearProgress variant="determinate" value={progress} sx={{ mt: 1, bgcolor: 'rgba(255,255,255,0.2)' }} />
                  <Typography variant="body1" mt={1}>XP: {auth.user?.xp} / {xpToNext}</Typography>
                  <Button variant="contained" sx={{ mt: 2, bgcolor: '#ff9800' }}>View Progress</Button>
                </CardContent>
              </Card>
            </motion.div>
          </Grid>
          <Grid item xs={12} md={4}>
            <motion.div whileHover={{ scale: 1.05 }}>
              <Card sx={{ bgcolor: 'linear-gradient(135deg, #f093fb 0%, #f5576c 100%)', color: 'white' }}>
                <CardContent>
                  <Typography variant="h4">üî• Streak: 0</Typography>
                  <Chip label="Badges: 0" sx={{ mt: 1, bgcolor: 'rgba(255,255,255,0.2)', color: 'white' }} />
                  <Chip label="Achievements: 0" sx={{ mt: 1, bgcolor: 'rgba(255,255,255,0.2)', color: 'white' }} />
                  <Button variant="contained" sx={{ mt: 2, bgcolor: '#ff9800' }}>View Achievements</Button>
                </CardContent>
              </Card>
            </motion.div>
          </Grid>
          <Grid item xs={12} md={4}>
            <motion.div whileHover={{ scale: 1.05 }}>
              <Card sx={{ bgcolor: 'linear-gradient(135deg, #4facfe 0%, #00f2fe 100%)', color: 'white' }}>
                <CardContent>
                  <Typography variant="h4">üìö Subjects to Master</Typography>
                  {courses.slice(0, 2).map(course => (
                    <Chip key={course._id} label={course.title} sx={{ mt: 1, mr: 1, bgcolor: 'rgba(255,255,255,0.2)', color: 'white' }} />
                  ))}
                  <Button variant="contained" sx={{ mt: 2, bgcolor: '#ff9800' }}>Explore</Button>
                </CardContent>
              </Card>
            </motion.div>
          </Grid>
        </Grid>
      </motion.div>
    </Box>
  );
};

export default Dashboard;
